import './Intro.css';
import me_headshot from '../../images/me_headshot.png';

const Intro = () => {
  return (
    <div id='topContainer'>
      <img src={me_headshot} width='400px'/>
      <div className='contentDiv'>
        <h1 id=''>Jon Halquist</h1>
      </div>
    </div>
  )
};

export default Intro;
